    //     // ... connect all signals from dut_interface
    // );
// Clock generation
    initial begin
        clk = 0;
        forever #2 clk = ~clk;
    end

    // Reset generation
    initial begin
        rst_n = 1'b0;
        #10 rst_n = 1'b1;
    end

    initial begin
        // Set virtual interface in config_db
uvm_config_db#(virtual dut_interface)::set(null, "*", "vif", dif);
// Run test
        run_test("example_test");
    end
endmodule
